import React, { useEffect, useState, useContext } from "react";
import { AuthContext } from "../context/AuthContext"; // Importer AuthContext
import axios from "axios";

const API_URL = "http://localhost:3010/api";

interface Post {
  id: string;
  message: string;
  photoUrl?: string;
  author: string;
  createdAt: string;
}

const Profile: React.FC = () => {
  const { user, posts, logout } = useContext(AuthContext)!; // R√©cup√©rer user et posts depuis AuthContext
  const [activeTab, setActiveTab] = useState<string>("profil");
  const [postMessage, setPostMessage] = useState<string>("");
  const [postPhoto, setPostPhoto] = useState<string>("");
  const [localPosts, setLocalPosts] = useState<Post[]>(posts); // √âtat local pour √©viter les re-rendus inutiles

  useEffect(() => {
    setLocalPosts(posts);
  }, [posts]); // Met √† jour les posts affich√©s si les posts changent dans le contexte

  const handlePostSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    if (postMessage.trim() === "" && postPhoto.trim() === "") return;

    try {
      const { data } = await axios.post(
        `${API_URL}/posts`,
        { message: postMessage, photoUrl: postPhoto },
        { headers: { Authorization: `Bearer ${localStorage.getItem("token")}` } }
      );

      setLocalPosts([data, ...localPosts]); // Ajout en local pour r√©activit√© imm√©diate
      setPostMessage("");
      setPostPhoto("");
    } catch (error) {
      console.error("Erreur lors de l'envoi du post :", error);
      alert("Impossible de publier le post.");
    }
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <h1>Mon espace</h1>
      <button onClick={logout}>D√©connexion</button>

      <nav style={{ marginBottom: "20px" }}>
        <button onClick={() => setActiveTab("profil")}>Profil</button>
        <button onClick={() => setActiveTab("admin")}>Admin</button>
        <button onClick={() => setActiveTab("chat")}>Espace Chat</button>
        <button onClick={() => setActiveTab("messagerie")}>Messagerie</button>
      </nav>

      {activeTab === "profil" && (
        <div>
          <h2>Bienvenue, {user?.name} üëã</h2>
          <form onSubmit={handlePostSubmit} style={{ marginBottom: "20px" }}>
            <textarea
              value={postMessage}
              onChange={(e) => setPostMessage(e.target.value)}
              placeholder="Votre message..."
              rows={4}
              cols={50}
            />
            <input
              type="text"
              value={postPhoto}
              onChange={(e) => setPostPhoto(e.target.value)}
              placeholder="URL de la photo (optionnel)"
              style={{ display: "block", marginBottom: "10px", width: "300px" }}
            />
            <button type="submit">Poster</button>
          </form>
          <h3>Publications</h3>
          {localPosts.length === 0 ? (
            <p>Aucune publication.</p>
          ) : (
            <ul>
              {localPosts.map((post) => (
                <li key={post.id} style={{ marginBottom: "10px", borderBottom: "1px solid #ccc", paddingBottom: "10px" }}>
                  <strong>{post.author}</strong>
                  <p>{post.message}</p>
                  {post.photoUrl && <img src={post.photoUrl} alt="Publication" style={{ maxWidth: "200px" }} />}
                  <p><small>Publi√© le {new Date(post.createdAt).toLocaleString()}</small></p>
                </li>
              ))}
            </ul>
          )}
        </div>
      )}

      {activeTab === "admin" && (
        <div>
          <h2>Admin</h2>
          <p>G√©rez votre profil ici.</p>
        </div>
      )}
    </div>
  );
};

export default Profile;
